import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";
import {Layout,Input} from "element-react"
class Signup extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment>
            <Layout.Row gutter="10">
                <Layout.Col xs="8" sm="6" md="4" lg="3">
                    <div className="grid-content bg-purple">
                        <span className={"grid-contentp"}>取消</span>
                    </div>
                </Layout.Col>
                <Layout.Col xs="16" sm="6" md="8" lg="6">
                    <div className="grid-content bg-purple"><p className={"grid-contentsp"}>登录</p></div>
                </Layout.Col>
            </Layout.Row>
            <div className={"phone"}>
                <i className="el-icon-menu"></i>
                <span className="el-dropdown-link">
                <i className="el-icon-caret-bottom el-icon--right"></i>86
                     <Input
                         maxLengt={300}
                         type="textarea"
                         autosize={{ minRows: 1, maxRows: 2}}
                         placeholder="输入手机号"
                     />
                </span>
            </div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>
            <div></div>

        </Fragment>)
    }

}

export default withRouter(Signup);
